      SUBROUTINE DCEL(K,E,CAP)
      IMPLICIT REAL*8(A-H,O-Z)
      REAL*8 K
      DIMENSION C(9),D(9),A(9),B(9)
      DATA A(1)/9.666344259D-02/
      DATA A(2)/3.590092383D-02/
      DATA A(3)/3.742563713D-02/
      DATA A(4)/1.451196212D-02/
      DATA B(1)/1.2498593597D-01/
      DATA B(2)/6.880248576D-02/
      DATA B(3)/3.328355346D-02/
      DATA B(4)/4.41787012D-03/
      DATA C(1)/4.4325141463D-01/
      DATA C(2)/6.260601220D-02/
      DATA C(3)/4.757383546D-02/
      DATA C(4)/1.736506451D-02/
      DATA D(1)/2.4998368310D-01/
      DATA D(2)/9.2000180037D-02/
      DATA D(3)/4.069697526D-02/
      DATA D(4)/5.26449639D-03/
      ETA=1.D0-CAP*CAP
      DLNETA=DLOG(ETA)
      E=1.D0
      K=1.386294361119891D0
      ETAI=1.D0
      RK=0.5D0
      RE=0.D0
      DO 15 I=1,4
      ETAI=ETAI*ETA
      E=E+C(I)*ETAI
      K=K+A(I)*ETAI
      RE=RE+D(I)*ETAI
      RK=RK+B(I)*ETAI
  15  ENDDO
      E=E-DLNETA*RE
      K=K-DLNETA*RK
      RETURN
      END
